import React from 'react';
import { NavLink } from 'react-router-dom';
import './Header.scss'

const Header = () => {
    return (
        <header>
            <img src="images/logo.png" alt="Logo" />
            <nav>
                <p>Salut</p>
                <NavLink to='/accueil'>Accueil</NavLink>
            </nav>
        </header>
    );
};

export default Header;
